import React, { useState } from 'react';
import "./Chat.css"

const Chat = ( { history } ) => {
    return (
        <div className="chat-container">
            <div className="chat-header">
                <button id="btn-back" onClick={ () => {history.goBack()} }></button>
                Chat
            </div>
            <div className="chat-view">
                <div className="my-chat"> 안녕</div>
                <div className="your-chat"> 구래 안녕 내일 보장</div>
                <div className="your-chat"> 웅 빠이</div>
                <div className="my-chat"> 빠이</div>
            </div>
            <div className="enter-form">
                <input type="text" id="message"/>
                <input type="submit" value="Send" id="send" />
            </div>
        </div>
    );
